import { DataTable, Table } from '@primer/react/experimental';
import {
  Box,
  Label,
  LabelGroup,
  Pagination,
  RelativeTime,
  Text,
} from '@primer/react';
import { accessTokens, accessTokens as data } from '../../../data/Data';

export function AccessTokens() {
  const data = [
    {
      name: 'token-name',
      type: 'Private',
      updatedAt: <RelativeTime date={new Date()} />,
    },
    {
      name: 'example-repo',
      type: 'Private',
      updatedAt: <RelativeTime date={new Date()} />,
    },
    {
      name: 'example-repo',
      type: 'Private',
      updatedAt: <RelativeTime date={new Date()} />,
    },
    {
      name: 'example-repo',
      type: 'Private',
      updatedAt: <RelativeTime date={new Date()} />,
    },
    {
      name: 'example-repo',
      type: 'Private',
      updatedAt: <RelativeTime date={new Date()} />,
    },
  ];

  return (
    <Box>
      <Table.Container
        sx={{
          mt: 4,
        }}
      >
        <Table.Title
          as='h2'
          id='repositories'
        >
          Repositories
        </Table.Title>
        <Table.Subtitle
          as='p'
          id='repositories-subtitle'
        >
          A subtitle could appear here to give extra context to the data.
        </Table.Subtitle>
        <DataTable
          data={accessTokens}
          columns={[
            {
              header: 'Token',
              field: 'name',
              rowHeader: true,
              renderCell: (row) => (
                <LabelGroup>
                  <Label>{row.name}</Label>
                </LabelGroup>
              ),
            },
            {
              header: 'Total requests',
              field: 'type',
              renderCell: (row) => (
                <LabelGroup>
                  <Label>{row.name}</Label>
                </LabelGroup>
              ),
            },
            {
              header: 'Last rate limited',
              field: 'updatedAt',
              renderCell: (row) => <Text>{row.updatedAt}</Text>,
            },
          ]}
        />
      </Table.Container>
      <Box>
        <Pagination
          pageCount={4}
          currentPage={1}
          onPageChange={(e) => e.preventDefault()}
          showPages={{
            narrow: false,
          }}
        />
      </Box>
      {/* <Box sx={{ height: '100px' }} /> */}
    </Box>
  );
}
